import "./index.css";

const obj = {
    name : 'akshay',
    age : 27,
    deg : 'BE',
    college : "Rajarshi Shahu College of Engineering, Buldhana",
    hobb : {
        first:"Playing Cricket",
        second : 'Watching South Indian Movies'
    }
}

//object distructing method.

let {name:myname,age,deg,college,hobb} = obj;
console.log(`My name is ${name}. And I am ${age} years old. I have completed ${deg} at ${college}. My hoby is ${hobb.first}. `);

const App = ()=>{
    return(
    <>
